import React, { Component } from 'react';
import { Button, Container, Input} from 'reactstrap';
let temp = 0;
class Query extends Component {
    constructor() {
        super();
        this.state = {
            UserName: '',
            UserEmail: '',
            UserNumber: ''
        }
        this.UserName = this.UserName.bind(this);
        this.UserEmail = this.UserEmail.bind(this);
        this.UserNumber = this.UserNumber.bind(this);
        this.getQuote = this.getQuote.bind(this);
    }
    UserName(event) {
        this.setState({ UserName: event.target.value })
    }
    UserEmail(event) {
        this.setState({ UserEmail: event.target.value })
    }
    UserNumber(event) {
        this.setState({ UserNumber: event.target.value })
    }
    getQuote(event) {
        var forms = document.getElementsByClassName('needs-validation');
        Array.prototype.filter.call(forms, function (form) {
            form.addEventListener('submit', function (event) {
                if (form.checkValidity() === false) {
                    event.preventDefault();
                    event.stopPropagation();
                }
                temp = 1;
                form.classList.add('was-validated');
            }, false);
        });
        console.log(temp);
        debugger;
        if (temp == 1) {
            debugger;
            this.props.history.push("/Dashboard");
        }

    }
    render() {
        return (
            <div className="app flex-row align-items-center">
                <Container>
                    <form className="needs-validation">
                        <div className="input-group mb-3">
                            <div className="input-group-prepend">
                                <span className="input-group-text" id="basic-addon1">Name</span>
                            </div>
                            <input type="text" className="form-control" onChange={this.UserName} placeholder="Enter your Name" required aria-label="Username" aria-describedby="basic-addon1" />
                        </div>

                        <div className="input-group mb-3">
                            <div className="input-group-prepend">
                                <span className="input-group-text" id="basic-addon1">Email</span>
                            </div>
                            <Input type="email" className="form-control" onChange={this.UserEmail} placeholder="Enter your Email" required />
                        </div>

                        <div className="input-group mb-3">
                            <div className="input-group-prepend">
                                <span className="input-group-text">Phone</span>
                            </div>
                            <input type="text" className="form-control" onChange={this.UserNumber} placeholder="Enter your Number" aria-label="Enter your Number" required />
                        </div>

                        <div className="input-group mb-3">
                            <div className="input-group-prepend">
                                <span className="input-group-text">Upload</span>
                            </div>
                            <div className="custom-file">
                                <input type="file" className="custom-file-input" id="inputGroupFile01" />
                                <label className="custom-file-label" >Choose file</label>
                            </div>
                        </div>

                        <Button onClick={this.getQuote} type="submit" className="btn btn-primary" block>Get a quote</Button>

                    </form>
                </Container>
            </div>
        );
    }
}
export default Query;
